svg.script:
    //

  	const xmlns = "http://www.w3.org/2000/svg", xlinkns = "http://www.w3.org/1999/xlink";
  	// document.querySelector('#particles').style.display = 'none';
  	const models = [...document.querySelectorAll('#particles > g')];
  	const particlesBack = document.getElementById('particlesBack')
  	const particlesFront = document.getElementById('particlesFront');

  	const particles = [];

  	function getTrans(n, i) {
  		return n.transform.baseVal.getItem(i);
  	}

  	function addTrans(n) {
  		const tr = document.querySelector('svg').createSVGTransform();
  		return n.transform.baseVal.appendItem(tr);
  	}

    function spawn(initx) {
      const model = models[parseInt(Math.random() * models.length)];
      const g = document.createElementNS(xmlns, 'g'),
            use = document.createElementNS(xmlns, 'use');
      use.setAttributeNS(xlinkns, "xlink:href", "#" + model.id);
      g.appendChild(use);
      g.style.opacity = 0;

      (Math.random() < .3 ? particlesFront : particlesBack).append(g);

      const s = Math.random() + .25;
      const bbox = g.getBBox();

      addTrans(g).setTranslate(initx, Math.random() * 600);
      //addTrans(use).setScale(s, s);
      //addTrans(use).setTranslate(-bbox.width / 2, -bbox.height / 2);
      //addTrans(g).setRotate(Math.random() * 360, bbox.width / 2, bbox.height / 2);
      particles.push([g, 2 + Math.random() * 3.4]);
    }

    for (let i = 0; i < 10; i++) {
      spawn(Math.random() * 1200);
    }

    const dieX = 1100, fadeX = 1000;

  	function tick(t) {
  	  requestAnimationFrame(tick);
  	  particles.forEach((tuple, i) => {
  	  	const [p, speed] = tuple;
  	  	const tr = getTrans(p, 0);
  	  	const x = tr.matrix.e, y = tr.matrix.f;
		getTrans(p, 0).setTranslate(x + speed, y);
    if (p.style.opacity < 1) {
      p.style.opacity = parseFloat(p.style.opacity) + .05;
    }
    if (x > fadeX) {
      p.style.opacity = (dieX - x) / (dieX - fadeX);
    }
		if (x > dieX) {
          particles.splice(i, 1);
          p.remove();
		}
  	  });

  	  if (Math.random() < 0.05) {
  	  	spawn(-200);
  	  }
  	}
    requestAnimationFrame(tick);
   	//
